<div class="coursepress-content">
	<h3>Login</h3>
	<p>You are already logged in.</p>
	<p class="form-info-red">Invalid login.</p>
	<form name="loginform" id="student-settings" class="student-settings login-form" method="post">
		<p>
			<label class="username"><br>
				<span>Username</span><br>
				<input type="text" name="log" value="john@example.com" autocomplete="off" style="background-image: url(data:image/png;base64,); background-repeat: no-repeat; background-attachment: scroll; background-size: 16px 18px; background-position: 98% 50%; cursor: auto;"><br>
			</label><br>
			<label class="password"><br>
				<span>Password</span><br>
				<input type="password" name="pwd" value="verysecretpassword" autocomplete="off" style="background-image: url(&quot;data:image/png;base64,&quot;); background-repeat: no-repeat; background-attachment: scroll; background-size: 16px 18px; background-position: 98% 50%; cursor: auto;"><br>
			</label>
		</p>
		<p><label class="signup-link full"></label></p>
		<p>
			<br>
			<label class="forgot-link half-left"><br>
				<a href="#">Forgot Password?</a><br>
			</label><br>
			<label class="submit-link half-right"><br>
				<input type="submit" name="wp-submit" id="wp-submit" class="apply-button-enrolled" value="Log In"><br>
			</label><br>
		</p>
	</form>
</div>